import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

function App() {
  return (
    <header>
      <div>
        <label>
          <h1>FACEBOOK</h1>
          <input type="text" name="name" />
        </label>
      </div>
    </header>
  );
}

ReactDOM.render(<App />, document.querySelector("#root"));
